Cómo tomar la medición de oxígeno en sangre: 
1. Use el reloj con el ancho de un dedo debajo del hueso de la muñeca y colóquelo en una posición cómoda en la muñeca; 
2. Después de ingresar al modo de detección de oxígeno en sangre, quédese quieto, asegúrese de que su muñeca esté plana y el reloj esté mirando hacia arriba. Si está sentado, puede poner los brazos sobre la mesa con el reloj hacia arriba; 
3. Mantenga el brazo firme hasta que obtenga el resultado final .
